import React from 'react'

export const Welcome = () => {
  return (
    <article className="welcome-item">
                <h3 className="title">BIENVENIDO AL CENTRO DE REHABILITACIÓN BCM</h3>
                <h4 className="description">Guía rápida</h4>

                <p><strong>Pacientes:</strong> listado de pacientes del centro. Podrá entrar en más detalle a la historia clínica de cada paciente y editar los datos de estos</p>
                <p><strong>Nuevo paciente:</strong> añade un nuevo paciente al centro</p>
                <p><strong>Profesionales:</strong> listado de todos los profesionales sanitarios del centro médico</p>
                <p><strong>Nuevo profesional:</strong> añade un nuevo profesional sanitario al centro médico</p>
                

            </article>
  )
}
